import React, {Component} from 'react';
import {Col, Row} from 'reactstrap';

const people = [
  {
    name: "Naveen Kharwar",
    url: "{https://www.naveenkharwar.com/}",
    id: '1'
  },
]

class Credits extends Component{
  render() {
    return (
      <div>
        {
          people.map( person =>
            <div key={person.id}>
                <h1> {person.name} </h1>
                <link to={person.url}/>
                  <Route
                    path="/privacy-policy"
                    component={ Redirect }
                    loc="https://meetflo.zendesk.com/hc/en-us/articles/230425728-Privacy-Policies"
                  />
            </div>
          )
        }
      </div>
    );
  }
}

export default Credits;
